// react
import React, { Component } from 'react';

import { HomeArticleList } from '../../shared/HomeArticleList';

export class IndexSearch extends Component {
    render() {
        return (
            <div className="search-body">
                <div className="search_left-column search_banner-content">
                    Left banner
                </div>
                <div className="search_main">
                    {/*
                    // Home offer articles
                    */}
                    <section className="">
                        <div >
                            <HomeArticleList />
                        </div>
                    </section>
                </div>
                <div className="search_right-column search_banner-content">
                    Right banner
                </div>
            </div>
        );
    }
}
